import styled from "styled-components";


const Ex = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  margin: 90px 0px 100px 0px;
`;
const H1 = styled.h1`
  font-size: 37px;
  font-weight: 300;
  height: 58px;
`;
const P = styled.p`
  word-spacing: -2px;
  width: 100%;
  text-align: center;
  font-size: 19px;
  line-height: 1.5;
  color: rgba(0, 0, 0, 0.3);
  margin-bottom: 30px;
`;
const Headbutton = styled.button`
  width: 3.5rem;
  height: 2.5rem;
  margin: 0;
  background-color: #343a40;
  border: 1px solid rgba(255, 255, 255, 0.1);
  border-radius: 0.25rem;
  display: flex;
  align-items: center;
  color: lightgrey;
  justify-content: center;
  &:hover {
    cursor: pointer;
  }
  &:focus{
    border: 1px solid white;
  }
`;
function Maincomponent() {
  return (
    <Ex>
      <H1>Album example</H1>
      <P>
        Something short and leading about the collection below—its contents
        <br />, the creator, etc. Make it short and sweet, but not too short so
        folks don’t <br />
        simply skip over it entirely.
      </P>
      
        <Headbutton>
          onHoverColor={"rgba(0,105,217,1)"}
          onClick={console.log("hi")}
          height={"40px"}
          width={"150px"}
          border={"none"}
          fsize={"17px"}
          fcolor={"white"}
          text={"Main call to action"}
          color={"rgba(0,123,255)"}
        </Headbutton>
        <Headbutton>
          onHoverColor={"rgba(90,98,104,1)"}
          height={"40px"}
          width={"150px"}
          fsize={"17px"}
          fcolor={"white"}
          border={"none"}
          text={"Secondary action"}
          color={"gray"}
        </Headbutton>
      
    </Ex>
  );
}
export default Maincomponent;
